import React from 'react';
import { Link } from 'react-router-dom';
import ThemeToggle from './ThemeToggle';
import './Navbar.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="logo">
        <h1>Ricky Rain Frog</h1>
      </div>
      <div className="nav-links">
        <Link to="/">Home</Link>
        <a href="#gallery">Ricky's Gallery</a>
        <Link to="/dialog">Ricky's Dialog</Link>
        <Link to="/cartoon">Cartoon</Link>
        <ThemeToggle />
        <Link to="/shop" className="shop-button">Take Ricky Home</Link>
      </div>
    </nav>
  );
}

export default Navbar;
